			["customText"] = "function()\n    \n    local name, rank, icon, count, debuffType, duration, expirationTime\n    local unitCaster, canStealOrPurge, nameplateShowPersonal, spellId\n    local canApplyAura, isBossDebuff, isCastByPlayer, nameplateShowAll, timeMod\n    local currentCharges, maxCharges, cooldownStart, cooldownDuration, chargeModRate\n    local powerTypeString = \"SHIELDBLOCK\"\n    local spec = GetSpecializationInfo(GetSpecialization())\n    local region = aura_env.region\n    local bar = region.bar\n    local powerCenter = \"\"\n    local powerRight = \"\" \n    local powerLeft = \"\"\n    local j = 1    \n    local textLeft = region.text\n    local textRight = region.timer    \n    \n    -- exception for Protection Warrior\n    if spec == 73 then\n        currentCharges, maxCharges, cooldownStart, cooldownDuration, chargeModRate = GetSpellCharges(2565)\n        powerCenter = GetSpellCharges(2565)\n        if GetTime() - cooldownStart > 0 then\n            powerRight = string.format(\"%.1f\",(cooldownStart + cooldownDuration - GetTime()))..\"s\"\n        end\n        powerTypeString = \"SHIELDBLOCK\"\n    end\n    \n    -- exception for Brewmaster Monk\n    if spec == 268 then\n        currentCharges, maxCharges, cooldownStart, cooldownDuration, chargeModRate = GetSpellCharges(115308)\n        powerCenter = GetSpellCharges(115308)\n        if GetTime() - cooldownStart > 0 then\n            powerRight = string.format(\"%.1f\",(cooldownStart + cooldownDuration - GetTime()))..\"s\"\n        end\n        powerTypeString = \"IRONSKINBREW\"\n    end    \n    \n    -- exception for Vengeance Demon Hunter\n    if spec == 581 then\n        currentCharges, maxCharges, cooldownStart, cooldownDuration, chargeModRate = GetSpellCharges(203720)\n        powerCenter = GetSpellCharges(203720)\n        if GetTime() - cooldownStart > 0 then\n            powerRight = string.format(\"%.1f\",(cooldownStart + cooldownDuration - GetTime()))..\"s\"\n        end\n        powerTypeString = \"DEMONSPIKES\"\n    end        \n    \n    -- exception for Guardian Druid\n    if spec == 104 then\n        currentCharges, maxCharges, cooldownStart, cooldownDuration, chargeModRate = GetSpellCharges(22842)\n        powerCenter = GetSpellCharges(22842)\n        if GetTime() - cooldownStart > 0 then\n            powerRight = string.format(\"%.1f\",(cooldownStart + cooldownDuration - GetTime()))..\"s\"\n        end\n        powerTypeString = \"FRENZIEDREGENERATION\"\n    end            \n    \n    -- sets bar and background color\n    local c = aura_env.PowerBarColor[powerTypeString]    \n    region.bar:SetVertexColor(c.r,c.g,c.b)    \n    region.bar.bg:SetVertexColor(c.r/2,c.g/2,c.b/2)\n    \n    if not bar.centerText then\n        bar.centerText = bar:CreateFontString(nil, \"OVERLAY\", \"GameFontHighlight\")\n        bar.centerText:SetWordWrap(false)\n    end\n    local textCenter = bar.centerText    \n    textLeft:SetText(powerLeft) -- EXPEL HARM, etc\n    textCenter:SetText(powerCenter)\n    textRight:SetText(powerRight)\n    textCenter:SetPoint(\n        \"CENTER\",\n        bar,\n        \"CENTER\",\n        0,\n        0\n    )\n    textCenter:SetFont(textLeft:GetFont())\n    textCenter:Show()\n    \n    -- sets sparks\n    while bar[\"spark\"..j] do\n        bar[\"spark\"..j]:Hide()\n        j = j + 1\n    end    \n    \n    if aura_env.sparkPositionBySpec[spec] then\n        for i = 1, #aura_env.sparkPositionBySpec[spec] do\n            if not bar[\"spark\"..i] then\n                local spark = bar:CreateTexture(nil, \"ARTWORK\");\n                spark:SetDrawLayer(\"ARTWORK\", 3);\n                bar[\"spark\"..i] = spark\n            end        \n            bar[\"spark\"..i]:SetTexture(\"Interface\\\\AddOns\\\\WeakAuras\\\\Media\\\\Textures\\\\Square_White.tga\")\n            bar[\"spark\"..i]:SetWidth(1.1);\n            bar[\"spark\"..i]:SetHeight(bar.fg:GetHeight());\n            bar[\"spark\"..i]:SetBlendMode(\"ALPHAKEY\");\n            bar[\"spark\"..i]:SetVertexColor(0, 0, 0, 1)\n            bar[\"spark\"..i]:ClearAllPoints()\n            bar[\"spark\"..i]:SetPoint(\"LEFT\", bar, \"LEFT\", (bar:GetWidth()/100)*aura_env.sparkPositionBySpec[spec][i](), 0)\n            \n            bar[\"spark\"..i]:Show()\n            if aura_env.sparkPositionBySpec[spec][i]() == 0 then\n                bar[\"spark\"..i]:Hide()\n            end\n        end\n    end\nend",
