					["custom"] = "-- exception for Ironskin Brew, Demon Spikes, Frenzied Regeneration, and Shield Block\naura_env.comboMax = function()\n    local playerSpec = GetSpecializationInfo(GetSpecialization())\n    if playerSpec == 73 then\n        currentCharges, maxCharges, cooldownStart, cooldownDuration, chargeModRate = GetSpellCharges(2565)\n    elseif playerSpec == 268 then\n        currentCharges, maxCharges, cooldownStart, cooldownDuration, chargeModRate = GetSpellCharges(115308)\n    elseif playerSpec == 581 then\n        currentCharges, maxCharges, cooldownStart, cooldownDuration, chargeModRate = GetSpellCharges(203720)\n    elseif playerSpec == 104 then\n        currentCharges, maxCharges, cooldownStart, cooldownDuration, chargeModRate = GetSpellCharges(22842)            \n    end    \n    return maxCharges or 0\nend\n\n-- modified from https://github.com/Gethe/wow-ui-source/blob/live/FrameXML/UnitFrame.lua\naura_env.PowerBarColor = {};\naura_env.PowerBarColor[\"DEMONSPIKES\"] = { r = 0.60, g = 0.60, b = 0.60 };\naura_env.PowerBarColor[\"SHIELDBLOCK\"] = { r = 0.60, g = 0.60, b = 0.60 };\naura_env.PowerBarColor[\"FRENZIEDREGENERATION\"] = { r = 0.00, g = 0.70, b = 0.00 };\naura_env.PowerBarColor[\"IRONSKINBREW\"] = { r = 0.60, g = 0.60, b = 0.60 };\n\naura_env.sparkPositionBySpec = {}\n\naura_env.sparkPositionBySpec[73] = { -- Protection\n    [1] = function()            \n        if 1/aura_env.comboMax() < 1 then\n            return 1/aura_env.comboMax()*100\n        end\n        return 0\n    end,\n    [2] = function()            \n        if 2/aura_env.comboMax() < 1 then\n            return 2/aura_env.comboMax()*100\n        end\n        return 0\n    end,\n    [3] = function()            \n        if 3/aura_env.comboMax() < 1 then\n            return 3/aura_env.comboMax()*100\n        end\n        return 0\n    end,\n    [4] = function()            \n        if 4/aura_env.comboMax() < 1 then\n            return 4/aura_env.comboMax()*100\n        end\n        return 0\n    end,            \n}     \naura_env.sparkPositionBySpec[268] = aura_env.sparkPositionBySpec[73] -- Brewmaster\naura_env.sparkPositionBySpec[581] = aura_env.sparkPositionBySpec[73] -- Vengeance\naura_env.sparkPositionBySpec[104] = aura_env.sparkPositionBySpec[73] -- Guardian\n\naura_env.shortenNumber = function(number)\n    if type(number) ~= \"number\" then\n        number = tonumber(number)\n    end\n    if not number then\n        return\n    end\n    \n    local affixes = {\n        \"\",\n        \"k\",\n        \"m\",\n        \"b\",\n    }\n    \n    local affix = 1\n    local dec = 0\n    local num1 = math.abs(number)\n    while num1 >= 1000 and affix < #affixes do\n        num1 = num1 / 1000\n        affix = affix + 1\n    end\n    if affix > 1 then\n        dec = 2\n        local num2 = num1\n        while num2 >= 10 do\n            num2 = num2 / 10\n            dec = dec - 1\n        end\n    end\n    if number < 0 then\n        num1 = -num1\n    end\n    \n    return string.format(\"%.\"..dec..\"f\"..affixes[affix], num1)\nend",
					["do_custom"] = true,
				},
			},
