					["colorFunc"] = "function(progress, r1, g1, b1, a1, r2, g2, b2, a2)    \n    \n    aura_env.count = 0\n    count = aura_env.count\n    aura_env.name = \"\"\n    name = aura_env.name\n    \n    if WA_GetUnitBuff('player','Shark Infested Waters') then --25%Crit\n        count = count + 1\n        name = name .. \"Crit + \"\n    end\n    \n    if WA_GetUnitBuff('player','True Bearing') then -- CDR\n        count = count + 1\n        name = name .. \"CDR + \"\n    end\n    \n    if WA_GetUnitBuff('player','Jolly Roger') then -- ExtraHit\n        count = count + 1\n        name = name .. \"Hit + \"\n    end\n    \n    if WA_GetUnitBuff('player','Grand Melee') then --ATKSpeed Leech\n        count = count + 1\n        name = name .. \"Speed + \"\n    end\n    \n    if WA_GetUnitBuff('player','Buried Treasure') then -- EnergyReg\n        count = count + 1\n        name = name .. \"Reg + \"\n    end\n    \n    if WA_GetUnitBuff('player','Broadsides') then -- +1CP\n        count = count + 1\n        name = name .. \"CP + \"\n    end\n    \n    if count == 5 then\n        aura_env.count = \"5\"\n        aura_env.name = \"zomg\"\n        return 1,0,0,1 -- red        \n    elseif count >= 3 then\n        aura_env.count = \"3\"\n        aura_env.name = name\n        return 1,1,0,1 -- yellow\n    elseif count == 2 then        \n        aura_env.count = \"2\"      \n        aura_env.name = name\n        return 0,153/255,53/255,1 --green\n    elseif count == 1 then\n        aura_env.count = \"1\"\n        aura_env.name = name\n        return 41/255,50/255,55/255,1 --bluegray\n    else\n        aura_env.count = \"\"\n        aura_env.name = name\n        return 41/255,50/255,55/255,1 --bluegray\n        \n    end    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
