				["finish"] = {
				},
				["init"] = {
					["custom"] = "if not IRONI_NAMEPLATE_TOT then\n    IRONI_NAMEPLATE_TOT = {}\nend\naura_env.nextCheck = 0\naura_env.myGUID = UnitGUID('player')\naura_env.updateNameplate = function(unitID, new, hide)\n    if not unitID then return end\n    if hide then\n        if IRONI_NAMEPLATE_TOT[unitID] and IRONI_NAMEPLATE_TOT[unitID].shown  then\n            IRONI_NAMEPLATE_TOT[unitID]:Hide()\n            IRONI_NAMEPLATE_TOT[unitID].shown = false\n        end\n    else\n        if new then\n            local o = WeakAurasSaved.displays[aura_env.id]\n            if not IRONI_NAMEPLATE_TOT[unitID] then\n                IRONI_NAMEPLATE_TOT[unitID] = CreateFrame('frame',nil, UIParent)\n                IRONI_NAMEPLATE_TOT[unitID]:SetSize(1,1)\n                IRONI_NAMEPLATE_TOT[unitID]:SetFrameStrata('HIGH')\n                IRONI_NAMEPLATE_TOT[unitID].text = IRONI_NAMEPLATE_TOT[unitID]:CreateFontString()\n                IRONI_NAMEPLATE_TOT[unitID].text:SetFont(LibStub(\"LibSharedMedia-3.0\"):Fetch(\"font\", o.font), o.fontSize, o.outline)\n                IRONI_NAMEPLATE_TOT[unitID].text:SetPoint(o.justify, IRONI_NAMEPLATE_TOT[unitID], o.justify, 0,0)\n                IRONI_NAMEPLATE_TOT[unitID].text:SetJustifyH(o.justify)\n            end\n            local nameplate = C_NamePlate.GetNamePlateForUnit(unitID)\n            if not nameplate then return end\n            IRONI_NAMEPLATE_TOT[unitID]:ClearAllPoints()\n            IRONI_NAMEPLATE_TOT[unitID]:SetPoint(o.anchorPoint, nameplate, o.selfPoint, (o.xOffset or 0),(o.yOffset or 0))\n            IRONI_NAMEPLATE_TOT[unitID]:Show()\n            IRONI_NAMEPLATE_TOT[unitID].shown = true\n        end\n        if not IRONI_NAMEPLATE_TOT[unitID].shown then return end\n        local n = UnitName(unitID..'target')\n        --if not n then\n        if not n or (aura_env.myGUID == UnitGUID(unitID..'target')) then\n            IRONI_NAMEPLATE_TOT[unitID].text:SetText(' ')\n            return\n        end\n        local name = iCN_GetName and iCN_GetName(n) or n\n        local _,class = UnitClass(unitID..'target')\n        local color = RAID_CLASS_COLORS[class] and RAID_CLASS_COLORS[class].colorStr or \"ffffffff\"\n        IRONI_NAMEPLATE_TOT[unitID].text:SetFormattedText('|c%s%s|r',color,name)\n    end\nend",
