						},
						["custom"] = "function(waEvent, unitID,...)\n    if waEvent == 'NAME_PLATE_UNIT_ADDED' then\n        aura_env.updateNameplate(unitID,true)\n    elseif waEvent == 'NAME_PLATE_UNIT_REMOVED' then\n        aura_env.updateNameplate(unitID,nil,true)\n    elseif waEvent == 'UNIT_TARGET' then\n        if unitID and unitID:find('nameplate') then\n            aura_env.updateNameplate(unitID)\n        end\n    else -- FRAME_UPDATE\n        if GetTime() >= aura_env.nextCheck then\n            aura_env.nextCheck = GetTime()+0.1\n            for i = 1, 40 do\n                if UnitExists('nameplate'..i) then\n                    aura_env.updateNameplate('nameplate'..i, true)\n                else\n                    break\n                end\n            end\n        end \n    end\nend",
