						["events"] = "GUILD_ROSTER_UPDATE",
						["custom"] = "function(event,update)\n    if WA_ELVA_GUILD_ROSTER_UPDATE_RUNNING ~= nil then\n        return\n    end\n    WA_ELVA_GUILD_ROSTER_UPDATE_RUNNING = true\n    \n    local oldroster = {}\n    local rankupdate = false\n    local rankupdates = {}\n    local levelupdate = false\n    local levelupdates = {}\n    local onlineupdate = false\n    local onlineupdates = {}\n    \n    if WA_ELVA_GUILD_ROSTER ~= nil then\n        oldroster = WA_ELVA_GUILD_ROSTER\n    end\n    \n    WA_ELVA_GUILD_ROSTER = {}\n    for i = 1,GetNumGuildMembers() do\n        local fullName, rank, rankIndex, level, class, zone, note, officernote, online, status, classFileName, achievementPoints, achievementRank, isMobile, canSoR, reputation = GetGuildRosterInfo(i)\n        fullName = Ambiguate(fullName, \"none\")\n        WA_ELVA_GUILD_ROSTER[fullName]={}\n        WA_ELVA_GUILD_ROSTER[fullName][\"note\"]=note\n        WA_ELVA_GUILD_ROSTER[fullName][\"rank\"]=rank\n        WA_ELVA_GUILD_ROSTER[fullName][\"rankIndex\"]=rankIndex\n        WA_ELVA_GUILD_ROSTER[fullName][\"online\"]=online\n        WA_ELVA_GUILD_ROSTER[fullName][\"level\"]=level\n        \n        \n        \n        \n        if oldroster ~= nil and fullName ~= Ambiguate(UnitName(\"player\"),\"none\") then\n            if oldroster[fullName] ~= nil then\n                if oldroster[fullName][\"rankIndex\"] <  WA_ELVA_GUILD_ROSTER[fullName][\"rankIndex\"] then\n                    --demote\n                    rankupdates[fullName] = {'-',rank}\n                    --rankupdate = true\n                elseif oldroster[fullName][\"rankIndex\"] >  WA_ELVA_GUILD_ROSTER[fullName][\"rankIndex\"] then\n                    --promote\n                    rankupdates[fullName] = {'+',rank}\n                    --rankupdate = true\n                end\n                if oldroster[fullName][\"level\"] < WA_ELVA_GUILD_ROSTER[fullName][\"level\"] then\n                    levelupdates[fullName] = level\n                    levelupdate = true\n                end\n                if oldroster[fullName][\"online\"] == nil and WA_ELVA_GUILD_ROSTER[fullName][\"online\"] == 1 then\n                    onlineupdates[fullName] = true\n                    --onlineupdate = true\n                end\n                \n            end\n        end\n    end\n    \n    if rankupdate and false then --off\n        for k,v in pairs(rankupdates) do\n            local realname = k\n            \n            if WA_ELVA_GUILD_ROSTER ~= nil then\n                if WA_ELVA_GUILD_ROSTER[k] ~= nil then\n                    realname = WA_ELVA_GUILD_ROSTER[k][\"note\"]\n                    if WA_ELVA_GUILD_ROSTER[WA_ELVA_GUILD_ROSTER[k][\"note\"]] ~= nil then\n                        realname = WA_ELVA_GUILD_ROSTER[WA_ELVA_GUILD_ROSTER[k][\"note\"]][\"note\"]\n                    end\n                end\n            end\n            local msg=\"\"\n            if v[1] == \"+\" then\n                --promote\n                msg = \"Gratulation, \"..realname..\"! Ich wünsche dir viel Glück und Erfolg in deiner neuen Rolle als \"..v[2]..\".\"\n            elseif v[1] == \"-\" then\n                --demote\n                msg = \"Mein Beileid \"..realname..\". Ich hoffe du bist nicht allzu lange \"..v[2]..\".\"\n            end\n            if msg ~= nil then\n                SendChatMessage(msg, \"GUILD\")\n            end\n        end\n    end\n    \n    if levelupdate ~= nil then\n        for k,v in pairs(levelupdates) do\n            local realname = k\n            \n            if WA_ELVA_GUILD_ROSTER ~= nil then\n                if WA_ELVA_GUILD_ROSTER[k] ~= nil then\n                    realname = WA_ELVA_GUILD_ROSTER[k][\"note\"]\n                    if WA_ELVA_GUILD_ROSTER[WA_ELVA_GUILD_ROSTER[k][\"note\"]] ~= nil then\n                        realname = WA_ELVA_GUILD_ROSTER[WA_ELVA_GUILD_ROSTER[k][\"note\"]][\"note\"]\n                    end\n                end\n            end\n            local msg=\"\"\n            \n            msg = \"Herzlichen Glückwunsch zum Erreichen der Stufe \"..v..\", \"..realname..\"!\"\n            \n            if msg ~= nil and v ~= MAX_PLAYER_LEVEL then\n                SendChatMessage(msg, \"GUILD\")\n                --print(msg)\n            end\n            \n        end\n    end\n    \n    if onlineupdate ~= nil and false then --off\n        for k,v in pairs(onlineupdates) do\n            local realname = k\n            \n            if WA_ELVA_GUILD_ROSTER ~= nil then\n                if WA_ELVA_GUILD_ROSTER[k] ~= nil then\n                    realname = WA_ELVA_GUILD_ROSTER[k][\"note\"]\n                    if WA_ELVA_GUILD_ROSTER[WA_ELVA_GUILD_ROSTER[k][\"note\"]] ~= nil then\n                        realname = WA_ELVA_GUILD_ROSTER[WA_ELVA_GUILD_ROSTER[k][\"note\"]][\"note\"]\n                    end\n                end\n            end\n            local msg=\"\"\n            \n            msg = \"Hallo, \"..realname..\"!\"\n            \n            if msg ~= nil then\n                SendChatMessage(msg, \"GUILD\")\n                --print(msg)\n            end\n            \n        end\n    end\n    WA_ELVA_ROSTER_UPDATE = time()\n    WA_ELVA_GUILD_ROSTER_UPDATE_RUNNING = nil\nend \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
