			["sparkOffsetX"] = 0,
			["customText"] = "-- This originally showed how much you needed until the \"halfway point\" (TotalScore == AzeriteGoal)\n-- But at least in normals I've proven that the Azerite elemental can spawn WAY WAY WAY before you hit that point.\n-- In a normal IE, goal is 6000, elemental spawned with Alliance == 3000 and Horde == 1000\n\nfunction()\n    local faction, _ = UnitFactionGroup(\"player\")\n    local playedSound = aura_env.playedSound\n    --local playedSound = false\n    if faction == \"Alliance\" then    \n        if aura_env.AzeriteGoal - 1000 <= aura_env.HordeScore and playedSound == false then\n            if not InCombatLockdown() then\n                SetCVar(\"Sound_MasterVolume\", 1)\n            end\n            \n            PlaySound(118563, \"MASTER\")\n            --print(\"trigger\")\n            playedSound = true\n        else\n            if not InCombatLockdown() then\n                SetCVar(\"Sound_MasterVolume\", 0.1)\n            end\n            playedSound = false            \n        end\n        \n        if aura_env.AzeriteGoal > aura_env.AllianceScore then\n            return \"Left: \"  .. (aura_env.AzeriteGoal - aura_env.AllianceScore)\n        end\n    end\n    if faction == \"Horde\" then\n        if aura_env.AzeriteGoal - 1000 <= aura_env.AllianceScore and playedSound == false then\n            if not InCombatLockdown() then\n                SetCVar(\"Sound_MasterVolume\", 1)\n            end\n            \n            PlaySound(118563, \"MASTER\")\n            --print(\"trigger\")\n            playedSound = true\n        else\n            if not InCombatLockdown() then\n                SetCVar(\"Sound_MasterVolume\", 0.1)\n            end\n            playedSound = false\n        end\n        \n        if aura_env.AzeriteGoal > aura_env.HordeScore then \n            return \"Left: \"  .. (aura_env.AzeriteGoal - aura_env.HordeScore)\n        end\n    end\n    return \"\"    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
			["customTextUpdate"] = "update",
			["displayTextLeft"] = "%p",
			["triggers"] = {
				{
					["trigger"] = {
						["use_absorbMode"] = true,
						["unit"] = "player",
						["customOverlay1"] = "function() -- \"Halfway\" point, supposed to spawn the big boi but that's not entirely confirmed\n    local width = aura_env.OverlayBarWidth / 2\n    local a = aura_env.AzeriteGoal - (width * (aura_env.AzeriteGoal * 2))\n    local b = aura_env.AzeriteGoal + (width * (aura_env.AzeriteGoal * 2))\n    return a, b\nend\n\n\n\n",
						["custom_hide"] = "custom",
						["debuffType"] = "HELPFUL",
						["buffShowOn"] = "showOnActive",
						["type"] = "custom",
						["unevent"] = "auto",
						["subeventSuffix"] = "_CAST_START",
						["use_unit"] = true,
						["custom"] = "-- WeakAuras doesn't support a \"load if in Island Expedition\" option (yet) so we need to do this instead\n-- One might be able to use the zone IDs but I need to check that later\n\nfunction()\n    local name = GetInstanceInfo()\n    if string.match(name, \"Islands\") then\n        aura_env.SetGoal()\n        aura_env.UpdateScores()\n        aura_env.playedSound = false\n        return true  \n    else\n        return false\n    end\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
						["event"] = "Health",
						["custom_type"] = "event",
						["customDuration"] = "function()\n    return aura_env.TotalScore, aura_env.AzeriteGoal * 2, true\nend",
						["spellIds"] = {
						},
						["events"] = "UPDATE_UI_WIDGET PLAYER_ENTERING_WORLD WORLD_MAP_UPDATE",
						["customOverlay2"] = "function()\n    local width = aura_env.OverlayBarWidth / 2\n    if aura_env.AllianceScore > 0 then\n        local a = aura_env.AllianceScore - (width * (aura_env.AzeriteGoal * 2))\n        local b = aura_env.AllianceScore + (width * (aura_env.AzeriteGoal * 2))\n        return a, b\n    else\n        return 0,0\n    end\nend\n\n\n",
						["subeventPrefix"] = "SPELL",
						["customOverlay3"] = "function()\n    local width = aura_env.OverlayBarWidth / 2\n    if aura_env.HordeScore > 0 then\n        local a = aura_env.TotalScore - (width * (aura_env.AzeriteGoal * 2))\n        local b = aura_env.TotalScore + (width * (aura_env.AzeriteGoal * 2))\n        return a, b\n    else\n        return 0,0\n    end\nend\n\n\n\n\n",
