			["actions"] = {
				["start"] = {
				},
				["init"] = {
					["custom"] = "-- User settings\naura_env.OverlayBarWidth = 0.01 -- Widths of the overlay bars on the progress bar, as percentage of total bar width\n\n-- Internal functions\naura_env.UpdateScores = function()\n    local WidgetFrame = {UIWidgetTopCenterContainerFrame:GetChildren()}\n    for _, child in pairs(WidgetFrame) do -- loop through the container's children\n        for k, v in pairs(child) do -- loop through the child frame\n            if k == \"LeftBar\" then\n                aura_env.AllianceScore = tonumber(v.Text:GetText())\n            end\n            if k == \"RightBar\" then\n                aura_env.HordeScore = tonumber(v.Text:GetText())\n            end\n        end\n    end\n    if aura_env.AllianceScore and aura_env.HordeScore then\n        aura_env.TotalScore = aura_env.AllianceScore + aura_env.HordeScore\n    else\n        aura_env.AllianceScore = 0\n        aura_env.HordeScore = 0\n        aura_env.TotalScore = 0\n    end\nend\n\naura_env.SetGoal = function()\n    local _, _, diff = GetInstanceInfo() -- Get current difficulty\n    if diff == 38 then\n        aura_env.AzeriteGoal = 6000\n    elseif diff == 39 then\n        aura_env.AzeriteGoal = 9000\n    else\n        aura_env.AzeriteGoal = 12000 -- Sets goal for Mythic, PvP, and city if debugging outside Island Expeditions\n    end\nend\n\n-- Initialize values\naura_env.UpdateScores()\naura_env.SetGoal()",
