				["init"] = {
					["custom"] = "-- exception for Rogue Combo Points, Warlock Soul Shards, Monk Chi\naura_env.comboMax = function()\n    local playerSpec = GetSpecializationInfo(GetSpecialization())\n    local secondPower = 0\n    if playerSpec == 265 or playerSpec == 266 or playerSpec == 267 then\n        secondPower = 7\n    end       \n    return UnitPowerMax(\"player\",secondPower) or 0\nend\n\n-- modified from https://github.com/Gethe/wow-ui-source/blob/live/FrameXML/UnitFrame.lua\naura_env.PowerBarColor = {};\naura_env.PowerBarColor[\"MANA\"] = { r = 0.25, g = 0.45, b = 0.60 };\naura_env.PowerBarColor[\"RAGE\"] = { r = 1.00, g = 0.00, b = 0.00 };\naura_env.PowerBarColor[\"FOCUS\"] = { r = 1.00, g = 0.50, b = 0.25 };\naura_env.PowerBarColor[\"ENERGY\"] = { r = 0.85, g = 0.80, b = 0.45 };\naura_env.PowerBarColor[\"COMBO_POINTS\"] = { r = 1.00, g = 0.96, b = 0.41 };\naura_env.PowerBarColor[\"RUNES\"] = { r = 0.50, g = 0.50, b = 0.50 };\naura_env.PowerBarColor[\"RUNIC_POWER\"] = { r = 0.00, g = 0.82, b = 1.00 };\naura_env.PowerBarColor[\"SOUL_SHARDS\"] = { r = 0.50, g = 0.32, b = 0.55 };\naura_env.PowerBarColor[\"LUNAR_POWER\"] = { r = 0.30, g = 0.52, b = 0.90 };\naura_env.PowerBarColor[\"HOLY_POWER\"] = { r = 0.95, g = 0.90, b = 0.60 };\naura_env.PowerBarColor[\"MAELSTROM\"] = { r = 0.00, g = 0.50, b = 1.00 };\naura_env.PowerBarColor[\"INSANITY\"] = { r = 0.30, g = 0.00, b = 0.75 };\naura_env.PowerBarColor[\"CHI\"] = { r = 0.00, g = 1.00, b = 0.75 };\naura_env.PowerBarColor[\"ARCANE_CHARGES\"] = { r = 0.10, g = 0.10, b = 1.00 };\naura_env.PowerBarColor[\"FURY\"] = { r = 0.60, g = 0.00, b = 0.80 };\naura_env.PowerBarColor[\"PAIN\"] = { r = 0.80, g = 0.80, b = 0.80 };\n\naura_env.sparkPositionBySpec = {}\n\naura_env.sparkPositionBySpec[104] = { -- Guardian\n    [1] = function()\n        local gory = WA_GetUnitAura(\"player\",\"Gory Fur\") or nil\n        local totalpower = UnitPower(\"player\",1) or 0\n        local cost = 45\n        if gory then\n            cost = cost - (45*0.25)\n        end\n        local total = totalpower - cost\n        \n        if total > 0 and total <= UnitPowerMax(\"player\",1) then\n            return total\n        end\n        return 0\n    end,\n    [2] = function()\n        local gory = WA_GetUnitAura(\"player\",\"Gory Fur\") or nil\n        local totalpower = UnitPower(\"player\",1) or 0\n        local cost = 90\n        if gory then\n            cost = cost - (45*0.25)\n        end\n        local total = totalpower - cost\n        \n        if total > 0 and total <= UnitPowerMax(\"player\",1) then\n            return total\n        end\n        return 0    \n    end,\n} \naura_env.sparkPositionBySpec[250] = { -- Blood\n    [1] = function()            \n        local name = WA_GetUnitAura(\"player\",\"Ossuary\") or nil\n        local currentpower = UnitPower(\"player\",6) or 0\n        local cost = 45\n        if name then\n            cost = cost - 5\n        end\n        local total = currentpower - cost\n        if total > 0 and total <= UnitPowerMax(\"player\",6) then\n            return total\n        end\n        return 0\n    end,\n    [2] = function()            \n        local name = WA_GetUnitAura(\"player\",\"Ossuary\") or nil\n        local currentpower = UnitPower(\"player\",6) or 0\n        local cost = 45\n        if name then\n            cost = cost - 5\n        end\n        local total = currentpower - cost*2\n        if total > 0 and total <= UnitPowerMax(\"player\",6) then\n            return total\n        end\n        return 0\n    end,\n    [3] = function()            \n        local name = WA_GetUnitAura(\"player\",\"Ossuary\") or nil\n        local currentpower = UnitPower(\"player\",6) or 0\n        local cost = 45\n        if name then\n            cost = cost - 5\n        end\n        local total = currentpower - cost*3\n        if total > 0 and total <= UnitPowerMax(\"player\",6) then\n            return total\n        end\n        return 0\n    end,    \n} \nlocal retMax = UnitPowerMax(\"player\",9) or 0\naura_env.sparkPositionBySpec[70] = { -- Retribution\n    [1] = function()            \n        if 1/retMax <= 1 then\n            return 1/retMax*100\n        end\n        return 0\n    end,\n    [2] = function()            \n        if 2/retMax <= 1 then\n            return 2/retMax*100\n        end\n        return 0\n    end,\n    [3] = function()            \n        if 3/retMax <= 1 then\n            return 3/retMax*100\n        end\n        return 0\n    end,\n    [4] = function()            \n        if 4/retMax <= 1 then\n            return 4/retMax*100\n        end\n        return 0\n    end,        \n    [5] = function()            \n        if 5/retMax <= 1 then\n            return 5/retMax*100\n        end\n        return 0\n    end,        \n    [6] = function()            \n        if 6/retMax <= 1 then\n            return 6/retMax*100\n        end\n        return 0\n    end,        \n}     \nlocal protCurrent, protMax = GetSpellCharges(53600)\naura_env.sparkPositionBySpec[66] = { -- Protection\n    [1] = function()            \n        if 1/protMax <= 1 then\n            return 1/protMax*100\n        end\n        return 0\n    end,\n    [2] = function()            \n        if 2/protMax <= 1 then\n            return 2/protMax*100\n        end\n        return 0\n    end,\n    [3] = function()            \n        if 3/protMax <= 1 then\n            return 3/protMax*100\n        end\n        return 0\n    end,\n    [4] = function()            \n        if 4/protMax <= 1 then\n            return 4/protMax*100\n        end\n        return 0\n    end,            \n}         \naura_env.sparkPositionBySpec[268] = { -- Brewmaster\n    [1] = function()\n        return 40 / UnitPowerMax(\"player\",3)*100\n    end,\n    [2] = function()\n        return 25 / UnitPowerMax(\"player\",3)*100\n    end,\n}\naura_env.sparkPositionBySpec[269] = { -- Windwalker\n    [1] = function()\n        return 50 / UnitPowerMax(\"player\",3)*100\n    end\n}\naura_env.sparkPositionBySpec[265] = { -- Affliction\n    [1] = function()            \n        if 1/aura_env.comboMax() < 1 then\n            return 1/aura_env.comboMax()*100\n        end\n        return 0\n    end,\n    [2] = function()            \n        if 2/aura_env.comboMax() < 1 then\n            return 2/aura_env.comboMax()*100\n        end\n        return 0\n    end,\n    [3] = function()            \n        if 3/aura_env.comboMax() < 1 then\n            return 3/aura_env.comboMax()*100\n        end\n        return 0\n    end,\n    [4] = function()            \n        if 4/aura_env.comboMax() < 1 then\n            return 4/aura_env.comboMax()*100\n        end\n        return 0\n    end,        \n    [5] = function()            \n        if 5/aura_env.comboMax() < 1 then\n            return 5/aura_env.comboMax()*100\n        end\n        return 0\n    end,        \n    [6] = function()            \n        if 6/aura_env.comboMax() < 1 then\n            return 6/aura_env.comboMax()*100\n        end\n        return 0\n    end,  \n    [7] = function()            \n        if 7/aura_env.comboMax() < 1 then\n            return 7/aura_env.comboMax()*100\n        end\n        return 0\n    end, \n    [8] = function()            \n        if 8/aura_env.comboMax() < 1 then\n            return 8/aura_env.comboMax()*100\n        end\n        return 0\n    end, \n    [9] = function()            \n        if 9/aura_env.comboMax() < 1 then\n            return 9/aura_env.comboMax()*100\n        end\n        return 0\n    end,     \n}     \naura_env.sparkPositionBySpec[266] = aura_env.sparkPositionBySpec[265] -- Demonology\naura_env.sparkPositionBySpec[267] = aura_env.sparkPositionBySpec[265] -- Destruction\n\naura_env.shortenNumber = function(number)\n    if type(number) ~= \"number\" then\n        number = tonumber(number)\n    end\n    if not number then\n        return\n    end\n    \n    local affixes = {\n        \"\",\n        \"k\",\n        \"m\",\n        \"b\",\n    }\n    \n    local affix = 1\n    local dec = 0\n    local num1 = math.abs(number)\n    while num1 >= 1000 and affix < #affixes do\n        num1 = num1 / 1000\n        affix = affix + 1\n    end\n    if affix > 1 then\n        dec = 2\n        local num2 = num1\n        while num2 >= 10 do\n            num2 = num2 / 10\n            dec = dec - 1\n        end\n    end\n    if number < 0 then\n        num1 = -num1\n    end\n    \n    return string.format(\"%.\"..dec..\"f\"..affixes[affix], num1)\nend",
