			["customText"] = "function()\n    local name, rank, icon, count, debuffType, duration, expirationTime, unitCaster, canStealOrPurge, nameplateShowPersonal, spellId, canApplyAura, isBossDebuff, isCastByPlayer, nameplateShowAll, timeMod\n    local currentCharges, maxCharges, cooldownStart, cooldownDuration, chargeModRate\n    local powerType, powerTypeString = UnitPowerType(\"player\")\n    local spec = GetSpecializationInfo(GetSpecialization())\n    \n    -- exception for Retribution\n    if spec == 70 then\n        powerType, powerTypeString = 9, \"HOLY_POWER\"\n    elseif spec == 265 or spec == 266 or spec == 267 then\n        powerType, powerTypeString = 7, \"SOUL_SHARDS\"        \n    end\n    \n    local region = aura_env.region\n    local bar = region.bar\n    local powerCenter = aura_env.shortenNumber(UnitPower(\"player\",powerType))\n    local powerRight = \"\" \n    local powerLeft = \"\"\n    local j = 1    \n    local textLeft = region.text\n    local textRight = region.timer    \n    \n    -- exception for Protection\n    if spec == 66 then\n        currentCharges, maxCharges, cooldownStart, cooldownDuration, chargeModRate = GetSpellCharges(53600)\n        powerCenter = GetSpellCharges(53600)\n        if GetTime() - cooldownStart > 0 then\n            powerRight = string.format(\"%.1f\",(cooldownStart + cooldownDuration - GetTime()))..\"s\"\n        end\n        powerType = 9\n        powerTypeString = \"HOLY_POWER\"\n    end\n    \n    -- sets bar and background color\n    local c = aura_env.PowerBarColor[powerTypeString]    \n    local b = 0\n    bar:SetVertexColor(c.r,c.g,c.b)    \n    -- exception for Brewmaster Blackout Combo\n    if WA_GetUnitAura(\"player\",\"Blackout Combo\") then\n        c = aura_env.PowerBarColor[\"MANA\"]\n        region.border:SetBackdropBorderColor(c.r,c.g,c.b)\n    else\n        region.border:SetBackdropBorderColor(0,0,0)\n    end    \n    bar.bg:SetVertexColor(c.r/2,c.g/2,c.b/2)\n    \n    -- sets text (current, percent, and max)\n    if powerType == 0 then\n        powerCenter = string.format(\"%.1f\",(UnitPower(\"player\",powerType)/UnitPowerMax(\"player\",powerType))*100)..\"%\"\n    end\n    \n    if UnitPowerMax(\"player\",powerType) >= 1000 then\n        powerRight = \"\"\n    end    \n    \n    --[[\n    \n    -- exception for free casts (Unholy, Druid, etc)\n    if WA_GetUnitAura(\"player\",\"Omen of Clarity\") or WA_GetUnitAura(\"player\",\"Moment of Clarity\") or WA_GetUnitAura(\"player\",\"Sudden Doom\") then\n        if WA_GetUnitAura(\"player\",\"Sudden Doom\") then\n            name, rank, icon, count, debuffType, duration, expirationTime = WA_GetUnitAura(\"player\",\"Sudden Doom\")\n            if count == 2 then\n                powerCenter = powerCenter..\" x2\"\n            end\n        end        \n        powerCenter = \"|cff00ff00\"..powerCenter..\"|r\"    \n    end\n    \n    ]]\n    \n    if not bar.centerText then\n        bar.centerText = bar:CreateFontString(nil, \"OVERLAY\", \"GameFontHighlight\")\n        bar.centerText:SetWordWrap(false)\n    end\n    local textCenter = bar.centerText    \n    textLeft:SetText(powerLeft) -- EXPEL HARM, etc\n    textCenter:SetText(powerCenter)\n    textRight:SetText(powerRight)\n    textCenter:SetPoint(\n        \"CENTER\",\n        bar,\n        \"CENTER\",\n        0,\n        0\n    )\n    textCenter:SetFont(textLeft:GetFont())\n    textCenter:Show()\n    \n    -- sets sparks\n    while bar[\"spark\"..j] do\n        bar[\"spark\"..j]:Hide()\n        j = j + 1\n    end    \n    \n    if aura_env.sparkPositionBySpec[spec] then\n        for i = 1, #aura_env.sparkPositionBySpec[spec] do\n            if not bar[\"spark\"..i] then\n                local spark = bar:CreateTexture(nil, \"ARTWORK\");\n                spark:SetDrawLayer(\"ARTWORK\", 3);\n                bar[\"spark\"..i] = spark\n            end        \n            bar[\"spark\"..i]:SetTexture(\"Interface\\\\AddOns\\\\WeakAuras\\\\Media\\\\Textures\\\\Square_White.tga\")\n            bar[\"spark\"..i]:SetWidth(1.1);\n            bar[\"spark\"..i]:SetHeight(bar.fg:GetHeight());\n            bar[\"spark\"..i]:SetBlendMode(\"ALPHAKEY\");\n            bar[\"spark\"..i]:SetVertexColor(0, 0, 0, 1)\n            bar[\"spark\"..i]:ClearAllPoints()\n            bar[\"spark\"..i]:SetPoint(\"LEFT\", bar, \"LEFT\", (bar:GetWidth()/100)*aura_env.sparkPositionBySpec[spec][i](), 0)\n            \n            bar[\"spark\"..i]:Show()\n            if aura_env.sparkPositionBySpec[spec][i]() == 0 then\n                bar[\"spark\"..i]:Hide()\n            end\n        end\n    end\nend",
