						["custom"] = "function(allstates, event,...)\n    if event == \"UNIT_SPELLCAST_START\" then\n        local caster, lineId, castSpellId = ...\n        if castSpellId == aura_env.castSpellId then\n            local _, _, icon, startMS, endMS = UnitCastingInfo(caster)\n            local sourceGUID = UnitGUID(caster)\n            C_Timer.After(0.35, function()\n                    if UnitIsPlayer(caster..\"target\") then\n                        if UnitIsUnit(caster..\"target\", \"player\") then\n                            local duration = (endMS - startMS) / 1000\n                            local expiration = endMS / 1000\n                            SendChatMessage(\"Barrage on ME!\", \"SAY\")\n                            allstates[sourceGUID] = {\n                                show = true,\n                                changed = true,\n                                progressType = \"timed\",\n                                duration = duration,\n                                expirationTime = expiration,\n                                autoHide = true,\n                                name = \"targeted\"\n                            }\n                        else\n                            local duration = (endMS - startMS) / 1000\n                            local expiration = endMS / 1000\n                            name = UnitName(caster..\"target\")\n                            name = WA_ClassColorName(name)\n                            if name then\n                                allstates[sourceGUID] = {\n                                    show = true,\n                                    changed = true,\n                                    progressType = \"timed\",\n                                    duration = duration,\n                                    expirationTime = expiration,\n                                    name = \"On \"..name,\n                                    autoHide = true,\n                                }\n                            end\n                        end\n                    end\n            end)\n        end\n    end\n    \n    if event == \"UNIT_SPELLCAST_SUCCEEDED\" or event == \"UNIT_SPELLCAST_INTERRUPTED\" or event == \"UNIT_SPELLCAST_FAILED\" then\n        local caster ,lineId,castSpellId = ...\n        if caster then\n            local sourceGUID = UnitGUID(caster)\n            if allstates[sourceGUID] then\n                allstates[sourceGUID].show = false\n                allstates[sourceGUID].changed = true\n            end        \n        end\n    end\n    \n    return true\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
