		["Druid-Guardian Frenzied Regen v5.5"] = {
			["outline"] = true,
			["text2Point"] = "TOP",
			["text1FontSize"] = 16,
			["cooldownTextEnabled"] = true,
			["displayText"] = "%c",
			["customText"] = "function(...)    \n    local i = 1\n    local cur = GetTime()\n    local total = 0\n    \n    --get total damage taken\n    while aura_env.dmgTaken[i] do\n        --grab table entries with time and damage\n        local time = aura_env.dmgTaken[i][1]\n        local dmg = aura_env.dmgTaken[i][2]\n        \n        --if the damage happened outside of the timewindow\n        if cur > time + aura_env.lastSec then\n            --remove the entry\n            table.remove(aura_env.dmgTaken, i)\n        else --otherwise\n            --add up the damage and go to next entry\n            total = total + dmg\n            i = i + 1\n        end\n    end\n    \n    --Mastery\n    --local mastery = 1 + GetMastery() / 200\n    \n    --Versatility\n    local vers = 1 + ((GetCombatRatingBonus(29) + GetVersatilityBonus(30)) / 100)\n    \n    --Leech\n    --local leech = 1 + GetLifesteal() / 100\n    \n    --Guardian of Elune\n    local goe = ((select(4, GetTalentInfo(6,2,1))) and WA_GetUnitBuff(\"player\", GetSpellInfo(213680))) and 1.2 or 1\n    \n    --check artifact traits\n    local currentRank = 0\n    if IsAddOnLoaded(\"LibArtifactData-1.0\") or LoadAddOn(\"LibArtifactData-1.0\") then\n        aura_env.LAD = aura_env.LAD or LibStub(\"LibArtifactData-1.0\")\n        if not aura_env.LAD:GetActiveArtifactID() then\n            aura_env.LAD:ForceUpdate()\n        end\n        local _, traits = aura_env.LAD:GetArtifactTraits()\n        if traits then\n            for _,v in ipairs(traits) do\n                if v.spellID == 200400 then\n                    currentRank = v.currentRank\n                    break\n                end\n            end\n        end\n    end\n    local trait = 1 + 0.05 * currentRank\n    \n    --Guardian Spirit\n    local gs = WA_GetUnitBuff(\"player\", GetSpellInfo(47788)) and 1.4 or 1\n    \n    --Divine Hymn\n    local dh = WA_GetUnitBuff(\"player\", GetSpellInfo(64844)) and 1.1 or 1\n    \n    --Protection of Tyr\n    local tyr = WA_GetUnitBuff(\"player\", GetSpellInfo(211210)) and 1.15 or 1\n    \n    --Life Cocoon\n    local lc = WA_GetUnitBuff(\"player\", GetSpellInfo(116849)) and 1.5 or 1\n    \n    --T17\n    local t17 = 1\n    local t17n, _, _, t17s = WA_GetUnitBuff(\"player\", GetSpellInfo(177969))\n    if t17n then\n        t17 = 1 + t17s * 0.1\n    end\n    \n    --T18\n    local t18 = WA_GetUnitBuff(\"player\", GetSpellInfo(192081)) and aura_env.GetNumSetPieces(\"T18\") >= 2 and 1.2 or 1\n    \n    --Skysec's Hold\n    local leg = IsEquippedItem(137025) and 0.12 or 0 --restores 12% of mastery affected maxhp\n    if leg > 0 then\n        --but the buff doesn't roll over like FR, so loses value if used twice in quick succession\n        local exp = select(6, WA_GetUnitBuff(\"player\", GetSpellInfo(208218))) or GetTime()\n        local rem = exp - GetTime()\n        if rem > 2 then\n            leg = leg * 1 / 3\n        elseif rem > 1 then\n            leg = leg * 2 / 3\n        end\n    end\n    \n    --calculate percentage and absolute healing values\n    local heal = total * aura_env.percDmg --damage taken * FR percentage\n    local perc = heal / UnitHealthMax(\"player\") --relative to maxHP\n    perc = math.max(aura_env.minHealthPerc, perc) --minimum FR percentage\n    perc = (perc * goe * trait * t17 * t18 * vers + leg) * gs * dh * tyr * lc --apply all multipliers\n    heal = perc * UnitHealthMax(\"player\") --get the actual heal value\n    \n    --store the values in aura_env variables to access them from other locations\n    aura_env.healing = heal\n    if aura_env.showAbsolute then\n        aura_env.display = aura_env.shortenNumber(heal)\n    else\n        aura_env.display = string.format(\"%.\"..aura_env.numDecimals..\"f%%\", perc*100)\n    end\n    \n    --coloring based on predicted percentage\n    local color = nil\n    for _, v in ipairs(aura_env.colors) do\n        if perc < v[1] then\n            break\n        else\n            color = v[2]\n        end\n    end\n    --should there be no entries, fall back to white\n    if not color then\n        color = \"ffffffff\"\n    end\n    \n    --the display variable will only contain one % so it can be printed correctly, replace that with %% so one % gets output into WA\n    return string.format(\"|c%s%s|r\", color, aura_env.display)\nend",
			["yOffset"] = 0,
			["anchorPoint"] = "CENTER",
			["cooldownSwipe"] = true,
			["text2"] = "%s",
			["customTextUpdate"] = "update",
			["cooldownEdge"] = false,
			["actions"] = {
				["start"] = {
					["custom"] = "\n\n",
					["do_custom"] = false,
				},
				["finish"] = {
					["custom"] = "\n\n",
					["do_custom"] = false,
				},
				["init"] = {
					["custom"] = "--settings start\naura_env.showAbsolute = false --set to true to show absolute heal value instead of percentage\naura_env.numDecimals = 1 --number of decimals to show for percentage based display (can also be 0)\naura_env.printHealToChat = false --print the predicted amount to the chat each time FR is used\naura_env.printSummary = false --print a short summary after boss encounters\n\n--if you want the text to be colored should certain percentages be reached, then you can insert or remove the entries in this table.\n--the entries have to be sorted by increasing percentages for this to work correctly.\n--this is independent of using aura_env.showAbsolute, meaning you can show the absolute value being healed, but the coloring is always based on percentages.\naura_env.colors = {\n    {0.0, \"ffffffff\"},\n    {0.3, \"ffe85537\"},\n    {0.5, \"ffff0000\"},\n}\n--settings end\n\n--DON'T TOUCH THIS!\naura_env.dmgTaken = {} --table to store damage taken\naura_env.lastSec = 5 --how long damage events are taken into account\naura_env.percDmg = 0.5 --percentage of the damage that is being healed\naura_env.minHealthPerc = 0.05 --minimum percentage that is being\n\naura_env.healing = nil --holds the value currently being predicted (always absolute)\naura_env.display = nil --holds the value currently being displayed (either absolute or percentage)\n\naura_env.stats = {} --table for stat tracking\naura_env.stats.active = false --is the stat tracking currently active\naura_env.stats.timesUsed = 0 --times that FR was used\naura_env.stats.predicted = 0 --total predicted amount of healing\naura_env.stats.healing = 0 --total amount of healing (and absorbed)\naura_env.stats.overheal = 0 --total amount of overhealing\naura_env.stats.external = 0 --total external overhealing caused while FR is active (including own mastery)\n\n--table to exclude certain abilities that deal damage but do not increase the healing done by FR\naura_env.exclude = {\n    [223414] = true, --Parasitic Fetter\n    [204611] = true, --Crushing Grip\n    [204658] = true, --Crushing Grip\n    [240448] = true, --Quaking\n    [243237] = true, --Bursting\n}\n\n--number shortening function\naura_env.shortenNumber = function(number)\n    if type(number) ~= \"number\" then\n        number = tonumber(number)\n    end\n    if not number then\n        return\n    end\n    \n    local affixes = {\n        \"\",\n        \"k\",\n        \"m\",\n        \"b\",\n    }\n    \n    local affix = 1\n    local dec = 0\n    local num1 = math.abs(number)\n    while num1 >= 1000 and affix < #affixes do\n        num1 = num1 / 1000\n        affix = affix + 1\n    end\n    if affix > 1 then\n        dec = 2\n        local num2 = num1\n        while num2 >= 10 do\n            num2 = num2 / 10\n            dec = dec - 1\n        end\n    end\n    if number < 0 then\n        num1 = -num1\n    end\n    \n    return string.format(\"%.\"..dec..\"f\"..affixes[affix], num1)\nend\n\n--set bonuses\naura_env.GetNumSetPieces = function(set, class) \n    class = class or select(2, UnitClass(\"player\"))\n    local sets = aura_env.sets[class]\n    if not sets then \n        return -1\n    end\n    local pieces = sets[set]\n    if not pieces then\n        return -1\n    end\n    local counter = 0\n    for _, itemID in ipairs(pieces) do\n        if IsEquippedItem(itemID) then\n            counter = counter + 1\n        end\n    end\n    return counter\nend\naura_env.sets = {\n    [\"DRUID\"] = {\n        [\"T18\"] = {\n            124246,\n            124255,\n            124261,\n            124267,\n            124272,\n        },\n    },\n}",
					["do_custom"] = true,
				},
			},
			["triggers"] = {
				{
					["trigger"] = {
						["duration"] = "1",
						["genericShowOn"] = "showOnActive",
						["names"] = {
						},
						["destUnit"] = "player",
						["debuffType"] = "HELPFUL",
						["type"] = "custom",
						["subeventSuffix"] = "_DAMAGE",
						["event"] = "Combat Log",
						["unevent"] = "timed",
						["spellIds"] = {
						},
						["custom"] = "function(event, ...)\n    \n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        \n        local  timestamp, subevent, _, source = select(1, ...)\n        \n        if subevent == \"SPELL_CAST_SUCCESS\" and source == UnitGUID(\"player\") and select(12, ...) == 22842 then\n            \n            --print message to chat\n            if aura_env.printHealToChat and aura_env.display then\n                \n                print(\"FR started for: \"..aura_env.display)\n                \n            end\n            \n            --collect predicted stats from display\n            if aura_env.stats.active and aura_env.healing then\n                \n                aura_env.stats.timesUsed = aura_env.stats.timesUsed + 1\n                aura_env.stats.predicted = aura_env.stats.predicted + aura_env.healing\n                \n            end\n            \n        end\n        \n        --target = player\n        if select(8, ...) == UnitGUID(\"player\") then\n            \n            --set selection offset to amount for baseline SWING_DAMAGE\n            local offset = 12\n            \n            --handle SPELL_ABSORBED events\n            if subevent == \"SPELL_ABSORBED\" then\n                \n                --if a spell gets absorbed instead of a melee hit, there are 3 additional parameters regarding which spell got absorbed, so move the offset 3 more places\n                local spellid, spellname = select(offset, ...)\n                if GetSpellInfo(spellid) == spellname then\n                    --check for excluded spellids before moving the offset\n                    if aura_env.exclude[spellid] then\n                        return\n                    end\n                    offset = offset + 3\n                end\n                \n                --absorb value is 7 places further\n                offset = offset + 7\n                table.insert(aura_env.dmgTaken, {GetTime(), (select(offset, ...))})\n                \n                --handle regular XYZ_DAMAGE events\n            elseif subevent:find(\"_DAMAGE\") then\n                \n                --don't include environmental damage (like falling etc)\n                if not subevent:find(\"ENVIRONMENTAL\") then\n                    \n                    --move offset by 3 places for spell info for RANGE_ and SPELL_ prefixes\n                    if subevent:find(\"SPELL\") then\n                        --check for excluded spellids before moving the offset\n                        local spellid = select(offset, ...)\n                        if aura_env.exclude[spellid] then\n                            return\n                        end\n                        offset = offset + 3\n                    elseif subevent:find(\"RANGE\") then\n                        offset = offset + 3\n                    end\n                    \n                    table.insert(aura_env.dmgTaken, {GetTime(), (select(offset, ...))})\n                end\n                \n            elseif aura_env.stats.active and subevent:find(\"_HEAL\") then --handle stats on heal events\n                \n                local spellid, _, _, amount, overhealing, absorbed = select(12, ...)\n                \n                if source == UnitGUID(\"player\") then\n                    \n                    if spellid == 22842 or spellid == 208218 then --Frenzied Regeneration or Skysec's Hold\n                        \n                        --add up the stats\n                        aura_env.stats.healing = aura_env.stats.healing + amount\n                        aura_env.stats.overheal = aura_env.stats.overheal + overhealing\n                        aura_env.stats.healing = aura_env.stats.healing + absorbed\n                        \n                    elseif spellid == 227034 and WA_GetUnitBuff(\"player\", GetSpellInfo(22842)) then --Nature's Guardian\n                        \n                        --while Frenzied Regeneration is up count the overhealing done by mastery towards the external stat\n                        aura_env.stats.external = aura_env.stats.external + overhealing\n                        \n                    end\n                    \n                    --if the source is not the player, there is overhealing, and the player has FR up\n                elseif overhealing > 0 and WA_GetUnitBuff(\"player\", GetSpellInfo(22842)) then\n                    \n                    --count the overhealing into the statistics\n                    aura_env.stats.external = aura_env.stats.external + overhealing\n                    \n                end\n                \n            end\n            \n        end\n        \n    elseif event == \"ENCOUNTER_START\" then\n        \n        --reset everything and set the stats collection active\n        if aura_env.printSummary then\n            aura_env.stats.timesUsed = 0\n            aura_env.stats.predicted = 0\n            aura_env.stats.healing = 0\n            aura_env.stats.overheal = 0\n            aura_env.stats.external = 0\n            aura_env.stats.active = true\n        end\n        \n    elseif event == \"ENCOUNTER_END\" then\n        \n        if aura_env.printSummary then\n            --print out the summary\n            print(string.format(\"%s summary:\", aura_env.id))\n            print(string.format(\"Times used: %d\", aura_env.stats.timesUsed))\n            print(string.format(\"Heal predicted: %s\", aura_env.shortenNumber(aura_env.stats.predicted)))\n            print(string.format(\"Total healing: %s\", aura_env.shortenNumber(aura_env.stats.healing)))\n            print(string.format(\"Effective healing: %s\", aura_env.shortenNumber(aura_env.stats.healing-aura_env.stats.overheal)))\n            print(string.format(\"Total overhealing: %s\", aura_env.shortenNumber(aura_env.stats.overheal)))\n            print(string.format(\"External overhealing: %s\", aura_env.shortenNumber(aura_env.stats.external)))\n            \n            --turn off the stats collection and reset everything\n            aura_env.stats.active = false\n            aura_env.stats.timesUsed = 0\n            aura_env.stats.predicted = 0\n            aura_env.stats.healing = 0\n            aura_env.stats.overheal = 0\n            aura_env.stats.external = 0\n        end\n        \n    end\n    \nend",
