 false\n                state.changed = true\n            end\n        end\n    end\nend\n-----------------------------------------\n--            USER SETTINGS            --\n-----------------------------------------\nlocal spacing =3 -- adjust to preference\nlocal perRow = 9 -- use 0 for no wrapping\nlocal horzontal_growth = \"RIGHT\" -- or \"LEFT\"\nlocal vertical_growth = \"UP\" -- or \"DOWN\"\n\nlocal do_sort = true -- or false\nlocal sort_by = \"order\" -- should be a valid aura_env.state child\nlocal sort_direction = \"DESC\" -- or \"ASC\"\n\n-----------------------------------------\n--             DO NOT TOUCH            --\n-----------------------------------------\n\nlocal aura_env = aura_env\naura_env.sortAndOffset = function()\n    local baseX = WeakAuras.regions[aura_env.id].region.xOffset\n    local baseY = WeakAuras.regions[aura_env.id].region.yOffset\n    local count = 0\n    local t = {}\n    for k, v in pairs(WeakAuras.clones[aura_env.id]) do\n        table.insert(t, v)\n    end\n    if do_sort then\n        if sort_direction == \"DESC\" then\n            table.sort(t, function(a,b) \n                    --[[if a.state[demonType] == \"imp\" and b.state[demonType] == \"imp\" then\n                        return a.state[value] < b.state[value] \n                    elseif a.state[demonType] ~= \"imp\" and b.state[demonType] ~= \"imp\" and a.state[demonType] == b.state[demonType] then \n                        return a.state[expirationTime] < b.state[expirationTime] \n                    else]]\n                    --print(a.state[order])\n                    return a.state.order < b.state.order\n                    \n            end)\n        end\n    end\n    for i, region in ipairs(t) do\n        if region.toShow then\n            local column = perRow > 0 and count % perRow or count\n            local xOff = (region.width + spacing) * column\n            xOff = horzontal_growth == \"LEFT\" and 0-xOff or xOff\n            local row = perRow > 0 and math.floor(count / perRow) or 0\n            local yOff = - row * (region.height + spacing)\n            yOff = vertical_growth == \"UP\" and 0-yOff or yOff\n            region:SetOffset(baseX + xOff, baseY + yOff)\n            count = count + 1\n        end\n    end\nend",
