       aura_env.HoGCost = 0\n                elseif spellId == 264130 then\n                    -- Power Sipon cast\n                    local lowestImp, imptable = time+time , true\n                    for z = 1,2 do\n                        for clone,state in pairs(allStates) do \n                            if state.demonType == \"imp\" then\n                                for i = 1,3 do\n                                    if state[\"impGUID\"..i]  then\n                                        --print(state[\"impGUID\"..i][2], lowestImp)\n                                        if state[\"impGUID\"..i][3] < lowestImp then\n                                            lowestImp, imptable = state[\"impGUID\"..i][3], state\n                                            --print(lowestImp)\n                                        end\n                                    end\n                                end\n                            end\n                        end\n                        for k,v in pairs(allStates) do\n                            if v == imptable then\n                                for i = 1,3 do \n                                    if lowestImp == v[\"impGUID\"..i][3] then\n                                        v.value = v.value - v[\"impGUID\"..i][3]\n                                        v.changed = true\n                                    end\n                                end\n                            end\n                        end\n                        \n                    end\n                    \n                    \n                elseif spellId == 196277 then\n                    -- implosion was cast\n                    -- If the player clipped implosion, account for the amount of imp spawns\n                    -- Wipe every imp from the table\n                    aura_env.imps = {}\n                    \n                    for clone,state in pairs(allStates) do \n                        if state.demonType ==