airs(allStates) do\n                            if state.demonType ~= \"Tyrant\" and state.expirationTime then\n                                --print(state.demonType)\n                                state.expirationTime = state.expirationTime + 15\n                                state.duration = state.duration + 15\n                                state.changed = true\n                                if state.demonType == \"imp\" then\n                                    for i = 1,3 do \n                                        if state[\"imp\"..i] and state[\"imp\"..i] ~= 1 then\n                                            state[\"imp\"..i][2] = state[\"imp\"..i][2] + 15\n                                        end\n                                    end\n                                end\n                            end\n                            \n                        end\n                        if select(4, GetTalentInfo(7, 2, 1)) then\n                            aura_env.imps = {}\n                            -- Demonic Consumption selected, wipe every imp from the table \n                            for clone,state in pairs(allStates) do \n                                if state.demonType == \"imp\" then\n                                    state.show = false\n                                    state.changed = true\n                                end\n                            end\n                        end\n                    elseif spellId == 104317 then\n                        -- HoG imp summon\n                        aura_env.imps[destGUID] = true\n                        for clone, state in pairs(allStates) do \n                            if state.demonType == \"imp\" and state ~= \"innerDemons\" then\n                                for i = 1,3 do\n                                    if state[\"imp\"..i] then\n                                        if state[\"imp\"..i] == 1 then\n                                            state[\"imp\"..i] = {destGUID, time + 20, 100}\n                                            state.value = state.value + 100\n                                            \n                                            state.show = true\n                                            state.changed = true\n                                            return true\n                                        end\n                                        \n                                    end\n                                end\n                            end\n                        end\n                    elseif spellId == 279910 then\n                        -- Inner Demon imp Summon\n                        aura_env.imps[destGUID] = true\n                        \n                        aura_env.IDTicker = aura_env.IDTicker or C_Timer.NewTicker(5, function()\n                                local time = GetTime()\n                                if allStates[\"innerDemons\"] then\n                                    for i = 1,3 do\n                                        if allStates[\"innerDemons\"][\"imp\"..i] and allStates[\"innerDemons\"][\"imp\"..i] ~= 1 then\n                                            --print(allStates[\"innerDemons\"][\"imp\"..i][2],time)\n                                            if allStates[\"innerDemons\"][\"imp\"..i][2] <= time then\n                                                \n                                                --print(\"impRemoved\")\n                                                allStates[\"innerDemons\"].total = allStates[\"innerDemons\"].total - allStates[\"innerDemons\"][\"imp\"..i][3]\n                                                allStates[\"innerDemons\"].value = allStates[\"innerDemons\"].value - allStates[\"innerDemons\"][\"imp\"..i][3]\n                                                allStates[\"innerDemons\"][\"imp\"..i] = 1\n                                                --print(allStates[\"innerDemons\"].total, allStates[\"innerDemons\"].value, \"ticker\")\n                                                allStates[\"innerDemons\"].changed = true\n                                            end\n                                        end\n                                    end\n                                end\n                            end\n                            \n                        )\n                        \n                        if not allStates[\"innerDemons\"] then\n                            allStates[\"innerDemons\"] = {\n                                changed = true,\n                                show = true,\n                                autoHide = true,\n                                value = 0,\n                                total = 0,\n                                imp1 = 1,\n                                imp2 = 1,\n                                imp3 = 1,\n                                progressType = \"static\",\n                                icon = aura_env.summonTable[spellId][3] or select(3, GetSpellInfo(spellId)),\n                                demonType = aura_env.summonTable[spellId][2],\n                                order = 1\n                            }\n                        end\n                        for i = 1,3 do\n                            if allStates[\"innerDemons\"][\"imp\"..i] and allStates[\"innerDemons\"][\"imp\"..i] == 1 then \n                                allStates[\"innerDemons\"][\"imp\"..i] = {destGUID, time + 20, 100}\n                                allStates[\"innerDemons\"].total = allStates[\"innerDemons\"].total + allStates[\"innerDemons\"][\"imp\"..i][3]\n                                allStates[\"innerDemons\"].value = allStates[\"innerDemons\"].value + allStates[\"innerDemons\"][\"imp\"..i][3]\n                                --print(allStates[\"innerDemons\"].total, allStates[\"innerDemons\"].value, \"adder\")\n                                allStates[\"innerDemons\"].changed = true\n                                break\n                            end\n                        end\n                        allStates[\"innerDemons\"].changed = true\n                    else\n                        -- Other demon spawns\n                        allStates[destGUID] = {\n                            changed = true,\n                            show = true,\n                            autoHide = true,\n                            expirationTime = time + aura_env.summonTable[spellId][1],\n                            duration = aura_env.summonTable[spellId][1],\n                            progressType = \"timed\",\n                            icon = aura_env.summonTable[spellId][3] or select(3, GetSpellInfo(spellId)),\n                            demonType = aura_env.summonTable[spellId][2],\n                            order = aura_env.summonTable[spellId][4]\n                        }\n                        \n                    end\n                    \n                end\n            end\n        elseif (subEvent == \"UNIT_DIED\" or subEvent == \"UNIT_DESTROYED\" or subEvent == \"UNIT_DISSIPATES\") and (aura_env.imps[destGUID] or allStates[destGUID]) then\n            if aura_env.imps[destGUID] then\n                for clone, state in pairs(allStates) do \n                    if state.demonType == \"imp\" and state ~= \"innerDemons\" then\n                        for i = 1,3 do \n                            if state[\"impGUID\"..i] and state[\"impGUID\"..i] ~= 1 then \n                                if state[\"impGUID\"..i][1] == destGUID then\n                                    state.value = state.value - state[\"impGUID\"..i][3]\n                                    aura_env.imps[destGUID] = nil\n                                    state[\"impGUID\"..i] = nil\n                                    break\n                                end\n                            end\n                        end\n                    elseif state.demonTyp == \"imp\" and state == \"innerDemons\" then\n                        if state[\"impGUID\"..i] and state[\"impGUID\"..i] ~= 1 then \n                            if state[\"impGUID\"..i][1] == destGUID then\n                                state.value = state.value - state[\"impGUID\"..i][3]\n                                state.total = state.total - state[\"impGUID\"..i][3]\n                                aura_env.imps[destGUID] = nil\n                                state[\"impGUID\"..i] = 1\n                                break\n                            end\n                        end\n                    end\n                end    \n            elseif allStates[destGUID] then\n                for clone, state in pairs(allStates) do\n                    if clone == destGUID then\n                        state.changed = true\n                        state.show = false\n                        break\n                    end\n                end\n            end\n        elseif subEvent == \"SPELL_CAST_SUCCESS\" and aura_env.imps[sourceGUID] then\n            -- an imp that we spawned casted a spell so - 20 energy\n            if not aura_env.tyrant or aura_env.tyrant < time then\n                for clone, state in pairs(allStates) do \n                    if state.demonType == \"imp\" and state ~= \"innerDemons\" then\n                        for i = 1,3 do \n                            if state[\"imp\"..i] and state[\"imp\"..i] ~= 1 then \n                                if state[\"imp\"..i][1] == sourceGUID then\n                                    state.value = state.value - 20 \n                                    state[\"imp\"..i][3] = state[\"imp\"..i][3] - 20\n                                    state.changed = true\n                                    if state.value <= 0 then\n                                        state.show = false\n                                        state.changed = true\n                                    end\n                                    return true\n                                end\n                            end\n                        end\n                    elseif state.demonType == \"imp\" and state == \"innerDemons\" then\n                        if state[\"imp\"..i] and state[\"imp\"..i] ~= 1 then \n                            if state[\"imp\"..i][1] == sourceGUID then\n                                state.value = state.value - 20 \n                                state[\"imp\"..i][3] = state[\"imp\"..i][3] - 20\n                                state.changed = true\n                                state.changed = true\n                                return true\n                            end\n                        end\n                    end\n                end      \n            end\n        end\n    end\n    return true\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
