				},
				["init"] = {
					["custom"] = "local r = aura_env.region\nif not r.bindList then\n    r.texPool = CreateTexturePool(UIParent,\"OVERLAY\",7)\n    r.bindList = {item = {}, spell = {}}\n    r.buttonList = {item = {}, spell = {}}\n    r.watchList = {item = {}, spell = {}}\n    r.overlayList = {item = {}, spell = {}}\n    r.modifier = {}\nend\n\nlocal texPool = r.texPool\nlocal bindList = r.bindList\nlocal buttonList = r.buttonList\nlocal watchList = r.watchList\nlocal overlayList = r.overlayList\nlocal modifier = r.modifier\nlocal config = aura_env.config\n\nlocal SetOverlayTexture\nif config.texture == 1 then\n    if config.useColor then        \n        SetOverlayTexture = function(texture)\n            texture:SetColorTexture(config.color[1],config.color[2],config.color[3],config.color[4])\n        end\n    else\n        SetOverlayTexture = function(texture)\n            texture:SetColorTexture(0.95,0.95,0.32,0.45)\n        end\n    end\nelseif config.texture == 2 then\n    if config.useColor then\n        SetOverlayTexture = function(texture)\n            texture:SetTexture([[Interface\\ContainerFrame\\UI-Icon-QuestBorder]])\n            texture:SetDesaturated(1)\n            texture:SetTexCoord(0,1,0,1)\n            texture:SetVertexColor(config.color[1],config.color[2],config.color[3],config.color[4])\n        end\n    else\n        SetOverlayTexture = function(texture)\n            texture:SetTexture([[Interface\\ContainerFrame\\UI-Icon-QuestBorder]])\n            texture:SetTexCoord(0,1,0,1)\n            texture:SetDesaturated(nil)\n        end\n    end\nelseif config.texture == 3 then\n    if config.useColor then\n        SetOverlayTexture = function(texture)\n            texture:SetTexture(config.customTexture)\n            texture:SetTexCoord(config.txLeft,config.txRight,config.txTop,config.txBottom)\n            texture:SetDesaturated(1)\n            texture:SetVertexColor(config.color[1],config.color[2],config.color[3],config.color[4])\n        end\n    else\n        SetOverlayTexture = function(texture)\n            texture:SetTexture(config.customTexture)\n            texture:SetTexCoord(config.txLeft,config.txRight,config.txTop,config.txBottom)\n            texture:SetDesaturated(nil)\n        end\n    end\nend\n\nlocal function GetActionId(slot, isItem)\n    local actionType, id, subType = GetActionInfo(slot)\n    if isItem then\n        if actionType == \"item\" then\n            return id\n        elseif actionType == \"macro\" then\n            return GetMacroItem(id)\n        end\n    else\n        if actionType == \"spell\" then\n            return id\n        elseif actionType == \"macro\" then\n            return GetMacroSpell(id)\n        end\n    end\n    return nil\nend\nlocal function FindBindings(id, isItem, frame)\n    if not frame then frame = UIParent end\n    if type(frame) == \"table\" and not frame:IsForbidden() then\n        local type = frame:GetObjectType()\n        if type == \"Frame\" or type == \"Button\" then\n            for _,child in ipairs({frame:GetChildren()}) do\n                FindBindings(id, isItem, child)\n            end\n        end\n        if type == \"CheckButton\" and frame.action then\n            local actionId = GetActionId(frame._state_action or frame.action, isItem)\n            if actionId == id  then\n                local slot = (frame._state_action or frame.action) % 12\n                if slot == 0 then slot = 12 end\n                local binds = {GetBindingKey(frame.GetBindingAction and frame:GetBindingAction() or frame.buttonType and frame.buttonType..slot or \"ACTIONBUTTON\"..slot)}\n                for _, bind in pairs(binds) do\n                    bindList[isItem and \"item\" or \"spell\"][bind] = id\n                end\n                buttonList[isItem and \"item\" or \"spell\"][id] = buttonList[isItem and \"item\" or \"spell\"][id] or {}\n                table.insert(buttonList[isItem and \"item\" or \"spell\"][id],frame)\n            end\n        end\n    end\nend\nlocal function WatchActionHandler(id,isItem,auraId,cloneId)\n    if not(id and auraId) then return end\n    watchList[isItem and \"item\" or \"spell\"][id] = watchList[isItem and \"item\" or \"spell\"][id] or {}\n    table.insert(watchList[isItem and \"item\" or \"spell\"][id],{auraId, cloneId})\n    FindBindings(id,isItem)\nend\nlocal function BindUpdateHandler()\n    for id in pairs(watchList.item) do\n        FindBindings(id,true)\n    end\n    for id in pairs(watchList.spell) do\n        FindBindings(id)\n    end\nend\nlocal FrameUpdateHandler\nlocal KeyDownHanlder\nif config.mode == 1 then\n    FrameUpdateHandler = function()\n        for action,list in pairs(overlayList) do\n            for auraInfo,overlay in pairs(list) do\n                local pushed\n                for _,button in pairs(buttonList[action][overlay.id]) do\n                    pushed = button:GetButtonState() == \"PUSHED\"\n                    if pushed then\n                        break\n                    end\n                end\n                if not pushed then\n                    texPool:Release(overlay)\n                    overlayList[action][auraInfo] = nil\n                end\n            end\n        end\n    end\n    KeyDownHanlder = function(self,key)\n        local mod\n        if modifier then\n            for modKey in pairs(modifier) do\n                mod = modKey:match(\"^.(.*)\")\n            end\n        end\n        key = mod and mod..\"-\"..key or key\n        for action,list in pairs(bindList) do\n            if list[key] then\n                for _,auraInfo in pairs(watchList[action][list[key]]) do\n                    local auraId, cloneId = auraInfo[1],auraInfo[2]\n                    local auraRegion = WeakAuras.GetRegion(auraId, cloneId) \n                    if auraRegion and auraRegion:IsVisible() and not(overlayList[action][auraId..(cloneId or \"\")]) then\n                        local overlay,new = texPool:Acquire()\n                        SetOverlayTexture(overlay)\n                        overlay:SetParent(auraRegion)\n                        overlay:SetPoint(\"TOPLEFT\",auraRegion,\"TOPLEFT\")\n                        overlay:SetPoint(\"BOTTOMRIGHT\",auraRegion,\"BOTTOMRIGHT\")\n                        overlay:Show()\n                        overlayList[action][auraId..(cloneId or \"\")] = overlay \n                        overlay.id = list[key]\n                    end\n                end\n            end\n        end\n    end\nelse\n    FrameUpdateHandler = function()\n    end\n    KeyDownHanlder = function(self,key)\n        local mod\n        if modifier then\n            for modKey in pairs(modifier) do\n                mod = modKey:match(\"^.(.*)\")\n            end\n        end\n        key = mod and mod..\"-\"..key or key\n        for action,list in pairs(bindList) do\n            if list[key] then\n                for _,auraInfo in pairs(watchList[action][list[key]]) do\n                    local auraId, cloneId = auraInfo[1],auraInfo[2]\n                    local auraRegion = WeakAuras.GetRegion(auraId, cloneId) \n                    if auraRegion and auraRegion:IsVisible() and not(overlayList[action][auraId..(cloneId or \"\")]) then\n                        local overlay,new = texPool:Acquire()\n                        SetOverlayTexture(overlay)\n                        overlay:SetParent(auraRegion)\n                        overlay:SetPoint(\"TOPLEFT\",auraRegion,\"TOPLEFT\")\n                        overlay:SetPoint(\"BOTTOMRIGHT\",auraRegion,\"BOTTOMRIGHT\")\n                        overlay:Show()\n                        overlayList[action][auraId..(cloneId or \"\")] = overlay \n                        overlay.id = list[key]\n                        C_Timer.After(0.1, function() texPool:Release(overlay); overlayList[action][auraId..(cloneId or \"\")] = nil end)\n                    end\n                end\n            end\n        end\n    end\nend\nlocal function ModifierHandler(self, event, key, state)\n    if event == \"MODIFIER_STATE_CHANGED\" then\n        modifier[key] = (state == 1) or nil\n    end\nend\naura_env.handlers ={\n    [\"WATCH_BUTTON_PRESS\"] = WatchActionHandler,\n    [\"UPDATE_BINDINGS\"] = BindUpdateHandler,\n    [\"PLAYER_TALENT_UPDATE\"] = BindUpdateHandler,\n    [\"FRAME_UPDATE\"] = FrameUpdateHandler\n}\nif not r.watcherFrame then\n    r.watcherFrame = CreateFrame(\"Frame\", nil, UIParent)\nend\nlocal watcherFrame = r.watcherFrame\nwatcherFrame:SetScript(\"OnKeyDown\",KeyDownHanlder)\nwatcherFrame:SetScript(\"OnEvent\",ModifierHandler)\nwatcherFrame:RegisterEvent(\"MODIFIER_STATE_CHANGED\")\nwatcherFrame:SetPropagateKeyboardInput(true)",
